import React from 'react'
import classes from './ProfileCard.module.css'

const ProfileCard = props => {
    return(
        <div className={classes.ProfileCard}>
            <h2>{props.username}</h2>
            <p>{props.first_name}</p>
            <p>{props.last_name}</p>
        </div>
    )
}
export default Profile
